        $" {Text}|" +
        $" {Flag}|" +
        $" {Number}|" +
        $" {Amount}|" +
        $" {Amount4}|" +
        $" {Amount5}|" +
        $" {PreciseDecimal}|" +
        $" {SampleState}|" +
        $" {DateOnly.ToShortDateString()}|" +
        $" {TimeOnly}|" +
