        $" {DateTimeMinute}|" +
        $" {DateTimeSecond}|" +
        $" OneMaster {OneMaster?.GetKeyOrHash()}|" +
        $" OtherMaster {OtherMaster?.GetKeyOrHash()}|" +
        $" {Optional}";
      onToTraceString(ref returnString);
      return returnString;
    }
